import Paragrafos from "../../Componentes/Paragrafos";
import Infoprojetos from "../../Componentes/InfoProjetos";
import Rodape from "../../Componentes/Rodape";
function Home () {
  return (
<> 
   <Navbar/>
   <Paragrafos
   texto={
   <div className="row bg-primary" id="teste" >
    
    <div style={{ marginBottom: '50 px' }}>
    </div>

      <div className="col-2" style={{ marginBottom: '22px' , padding: '0' , margin: '0'}}>
      </div>

      <div className="col-9 align-center text-white">
        <h1 className="text-white" style={{ fontWeight: 'bold' }}>Todos os projetos integrados das ETE's Conectados em um só Lugar</h1>

        <div style={{ marginBottom: '22px'}}></div>

        <p  className="text-white " style={{ fontSize: '20px' }}>  O Repositório conect ETE PE é uma base de dados online que objetiva reunir, de forma organizada e acessível, a produção científica e documental das ETE'S de toda RMR
        <br /> com o intuito de torná-la acessível aos pesquisadores e ao grande público nacional e internacional.</p>
        
          <div style={{ marginBottom: '50 px' }}></div>
          <div className="col-2"></div>

          
      </div>
    </div>}/>
   <Infoprojetos/>
   <Rodape/>
   
</>

  );
}

export default Home;
